@Kismet_Mujer alterada con las manos en las rodillas de la carrera que le hizo hacer la perra. Casi se cae rodando cuesta abajo encima de la pinocha. 
Antes de que pudiera responder se inclinó y le robo un beso.
-¡El que llegue primero al final de la cuesta elige la cena! -dijo mientras +
